  false,\n\t\"url\": null,\n\t\"notes\": \"The S_Fld_Haz_Ar table contains information
  about the flood hazards within the study area. A spatial file with locational information
  also corresponds with this data table. These zones are used by the federal Emergency
  Management Agency (FEMA) to designate the Special Flood Hazard Area (SFHA) and for
  insurance rating purposes. These data are the flood hazard areas that are or will
  be depicted on the Flood Insurance Rate Map (FIRM). A spatial file with locational
  information also corresponds with this data table. The spatial elements representing
  the flood zones are polygons. The entire area of the jurisdiction(s) mapped by the
  FIRM should have a corresponding flood zone polygon. There is one polygon for each
  contiguous flood zone designated. This is a modified Standard DFIRM Database table
  that includes Standard DFIRM Database items and Enhanced Database items. All items
  after SOURCE_CIT are Enhanced. More information can be found in the document 'Guidelines
  and Specifications for Flood Hazard Mapping Partners Appendix LGuidance for Preparing
  Draft Digital Data and DFIRM Database' located on this disk.\",\n\t\"owner_org\":
